import {Nav} from 'react-bootstrap';
import { Outlet } from 'react-router-dom';
import { LinkContainer } from 'react-router-bootstrap';
import { Card, Table } from 'react-bootstrap';


const Dashboard = (props) => {

    return (
        <>
        <UserCard user={props.user}/>
        <Navbar handleLogin={props.handleLogout}/>
        <Outlet/>
        </>
    )
}

export default Dashboard;



function Navbar(props) {
  return (
    <>
      <Nav className="justify-content-center" fill variant="tabs">
        <Nav.Item>
          <LinkContainer to="/home"><Nav.Link>Home</Nav.Link></LinkContainer>
        </Nav.Item>
        <Nav.Item>
          <LinkContainer to="/home/registration"><Nav.Link>Register</Nav.Link></LinkContainer>
        </Nav.Item>
        <Nav.Item>
          <LinkContainer to="/course/running"><Nav.Link>Running Courses</Nav.Link></LinkContainer>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link onClick={props.handleLogout}>Logout</Nav.Link>
        </Nav.Item>
      </Nav>
    </>
  );
}

function UserCard(props) {
  console.log(props);
  return (
      <div>
  <Card>
    <Card.Header>
    <Table hover>
    <thead>
      <tr>
        <th>{props.user.username}</th>
        <th>Last Name</th>
      </tr>
    </thead>
  </Table>
    </Card.Header>
    <Card.Body>
    <Table hover>
    <tbody>
      <tr>
        <th>First Name</th>
        <th>Last Name</th>
      </tr>
    </tbody>
  </Table>
    </Card.Body>
  </Card>
  </div>
  );
}
